// DietInsufficient.js
import React from 'react';

function DietInsufficient() {
  return (
    <div>
      <h1>Diet Insufficient</h1>
      <p>Your diet plan is insufficient. Please consider improving your nutritional intake.</p>
    </div>
  );
}

export default DietInsufficient;
